INSERT INTO `wikidb`.`jgsearchindex` VALUES  (1,'main page','  welcome to jaguar bpm site   jaguar is a bpm engine and modeler written in c why jaguar feature list development process development process development process roadmap risks and mitigation applications to be reviewed applications to be reviewed applications to be reviewed unit test framework for c wxwidgets '),
 (2,'why jaguar',' the new world needs new solutions and it needs a way to improve the current work flow jaguar is a business process management which leads to a fast implementation of new business process accurate upgrades of those processes and a fast feedback to the management what is the difference between jaguar and other bpms this is a complex question first i must say what is wrong in the other bpms to give an overview of the current situation the current bpms are not oriented to the final user which is the business analyst and does not provide the good environment to detect future problems and fix them also they does not provide a good way to communicate with other applications in a code less way other bpms are primary oriented to the developer team and will not be friendly with the business analyst jaguar is a bpm solution for all the team provides a good tool for business analyst to use and document their process knowledge and provides the tools for the development team to create a good implementation on the other hand jaguar is created to be the fastest solution in the market because it it\'s created from scratch as a business critical tool and supports all the main server distributions linux windows mac etc '),
 (3,'feature list',' here here\'s the main features of jaguar a nice workflow designer oriented to the standard bpm 2 0 a powerful bpm engine data manager rule engine based on business policies with zero code code library enabling a custom rule policies soa server integration tools query tool ');
INSERT INTO `wikidb`.`jgsearchindex` VALUES  (4,'roadmap',' pre-alpha version this version will be able to create a simple workflow manage simple data associated with it a preliminar rule management and renders user interface at runtime could be considered as a probe of concept estimated release date early march 2009   pre-alpha 1   network server only process requests and forward to the required controller bpm engine which supports manual and service tasks designer to create the work flow with manual and service tasks   pre-alpha 2   data management designer and engine this will support only string types without any foreign relationship   pre-alpha 3   policy rules  pre-alpha 4   data forms only text data without any validation  pre-alpha 5   data management foreign relationships data forms rules alfa version alfa version alfa version this version will complete the features created at the alpha version completing the bpmn 2 0 standard all the data types and complex forms estimated release date august 2009 beta version beta version beta version at this series of versions the application will contains all the bpmn 2 0 shapes data types forms rules code library and it will introduce the soa tools developers integration and query tools this version will contains all the features proposed and will be released to public testers estimated release date december 2009 release candicate release candicate release candicate this version will be a stable version with some bugs could be used at production environment estimated release date march 2010 final product final product final product this version is bug free and ready to execute at production environments estimated release date june 2010 '),
 (5,'risks and mitigation','  risk   mitigation  the bpmn 2 0 is not available at the creation of this document the first development cycles does not rely exclusibily in new features of the 2 0 especification it it\'s possible that the specification is ready at the start of the alfa version if not then the application will be 1 1 compliant instead of 2 0 new development language c this is a well known risk but the only way to mitigate it is working and reading some components of the designer will be a third party code the architecture of the designer must try to isolate the third party implementation to avoid future problems if we decided to change it this could impact the designer performance the company does not have any methodology currently implemented we\'re going to read the cmmi for development to select the key areas which needs improvement ');
INSERT INTO `wikidb`.`jgsearchindex` VALUES  (6,'pre-alpha 1',' main features to be addressed in this early version network server only process requests and forward to the required controller bpm engine which supports manual and service tasks designer to create the work flow with manual and service tasks pre-alpha 1 - development process '),
 (7,'pre-alpha 1 - development process',' the following are the common steps for every phase requirements analisys design implementation tests the phase will take todo to put in here the expected timeframe '),
 (8,'requirements',' requirement list here here\'s the requirement list for the current phase network server must receive simple workflow requests and send a result workflow engine must be able to execute a manual tasks and service tasks designer requirements create an activity change the activity task type create a sequence flow between two activities template template template  requirement id  &nbsp;  description  &nbsp;  precondition  &nbsp;  postcondition  &nbsp;  related documents  &nbsp;  full description  &nbsp;  accomplishment checklist  &nbsp; '),
 (9,'network server must receive simple workflow requests and send a result','  requirement id  1  description  network server must receive simple workflow requests and send a result  precondition  &nbsp;  postcondition  &nbsp;  related documents  requests lists pre-alpha 1 - development process  full description  the server must be capable of receive a socket connection and resolve the contents of the request create an object with the request values and forward it to a controller defined by the type of request the request will be as follows first 4 bytes will identify the type of request this will define the controller that will handle the request the next bytes will define each parameter as codename 2 bytes value siz 2 bytes and value contents if the value requires more than 1 single space then the next element will contain the same codename and the next bytes of the value in order to mark the end of the request the last byte will contain the value ffff 65535 because of this condition the codename will never be ffff every codename will be defined in each controller the following is the table of defined responses according to the request correct request 1 followed by the response with the same format described for the incomming parameters codename 2 bytes value size 2 bytes and value content if there there\'s not a controller to handle the request 901 the parameter list does not match the request definition 902 followed by a full string definition of the expected parameters comma separated the format of a parameter does not match the requested controller 903 followed by a full string definition of the expected parameters comma separated  accomplishment checklist  the test will send a valid request and will receive the line 1 followed by a well known response the test will send an invalid request and will receive the value 901 the test will send an valid request with an invalid parameter list and it will receive the value 902 will the description of the expected parameter list the test will send an valid request with an invalid parameter definition and it will receive the value 903 will the description of the expected parameter list ');
INSERT INTO `wikidb`.`jgsearchindex` VALUES  (10,'requests lists',' here here\'s the list of supported requests  request id   controller   parameter list   response  1 process instance creation 1 process definition id integer required 2 user id integer required 1 current process state xml xml current process state 1 execute token 1 process instance id integer required 2 token id integer required 3 user id integer required 1 current process state xml xml current process state '),
 (11,'xml current process state',' the legends are abbreviated to avoid any extra space required legends p process tag ts active tasks i id d description u users id es events e single event description '),
 (12,'workflow engine must be able to execute a manual tasks and service tasks','  requirement id  2  description  workflow engine must be able to execute a user and script tasks  precondition  process definition metadata must be created  postcondition  a process instance  related documents  workflow patterns bpmn specification designer requirements  full description  the workflow must implement manual and services tasks which are defined as a task is an atomic activity that is included within a process a task is used when the work in the process is not broken down to a finer level of process model detail generally an end-user and or an application are used to perform the task when it is executed a task object shares the same shape as the sub-process which is a rectangle that has rounded corners see figure 9 14 the task diagram conventions should be taken directly from the bpmn specification a script task is executed by a business process engine the modeler or implementer defines a script in a language that the engine can interpret when the task is ready to start the engine will execute the script when the script is completed the task will also be completed a user task is a typical u8e2809cworkflowu8e2809d task where a human performer performs the task with the assistance of a software application and is scheduled through a task list manager of some sort as it it\'s defined in the bpmn specification if a task does not have any incomming sequence flow and there there\'s no start event for the process then the task must be instanciated when the process is instanciated  accomplishment checklist  define a process with an user task followed by a script execute a test over it then the process should wait for an user input at the manual task and execute the actions associated with the service task once the script task was executed the process instance should be marked as closed '),
 (13,'workflow patterns',' the following site defines the diferent types of workflow patterns available at business workflow patterns the pre-alpha1 will include the following patterns sequence pattern ');
INSERT INTO `wikidb`.`jgsearchindex` VALUES  (14,'designer requirements',' here here\'s the set of designer requirements create an activity change the activity task type create a sequence flow between two activities '),
 (15,'create an activity','  requirement id  3  description  the designer should be able to create activities shapes  precondition  &nbsp;  postcondition  an activity shape is created and saved at the database  related documents  designer requirements  full description  the designer should be able to create activity shapes this will be scripts task by default and could be changed to other types of activities right clicking on it  accomplishment checklist  create an activity and check at the database level it it\'s there the designer must draw the shape at the same place when the user reopens the process definition '),
 (16,'change the activity task type','  requirement id  3 1  description  change an activity task type  precondition  a previously created activity already exists in the diagram  postcondition  the activity type must be changed the selected task type  related documents  designer requirements create an activity  full description  if the user wants to change the type of an activity he will right click on the activity shape and select a submenu item named change to which will list the possible options to change the type of the current activity to; he will select the appropiated option and the activity will be marked as the selected option was user manual service etc also the representation should change according to the bpmn specification the designer should list the appropriated options according to the current selection in this way the designer should not list in change to the user task type if the current activity is already a user task  accomplishment checklist  the user will create an activity right click on it and verify that the change to submenu lists the user activiy type select it and verifies that the shape actually change to user task the user will right click on the previous step shape and check that the submenu item change to will not list user task activity type because the current activity is already marked as user task type '),
 (17,'mark an activity as user task',' ');
INSERT INTO `wikidb`.`jgsearchindex` VALUES  (18,'create a sequence flow between two activities','  requirement id  4  description  create a sequence flow between two activities  precondition  the two activities were created in advance  postcondition  the two activities are joined by a sequence flow line  related documents  create an activity designer requirements workflow patterns  full description  a sequence flow is used to show the order that activities will be performed in a process each flow has only one source and only one target the source and target must be from the set of the following flow objects events start intermediate and end activities task and sub-process and gateways during performance or simulation of the process a token will leave the source flow object traverse down the sequence flow and enter the target flow object the shape must be taken directly from the bpmn specification for additional information take a look of the specification  accomplishment checklist  connect two different activities with the sequence flow save the change and check the database for the new connection change a sequence flow to different activities save the change and check the database for the new connection delete the sequence flow from a previously created save the change and check the database for the new connection ');
UNLOCK TABLES;
/*!40000 ALTER TABLE `jgsearchindex` ENABLE KEYS */;


